    "# Boolean functions\n",
    "def boolean_function_1(x1, x2, x3):\n",
    "    return x1 and x2 or x3\n",
    "\n",
    "def boolean_function_2(x1, x2, x3):\n",
    "    return not (x1 or x2 or x3)\n",
    "\n",
    "def boolean_function_3(x1, x2, x3):\n",
    "    return x1 or x2 or x3\n",
    "\n",
    "def boolean_function_4(x1, x2, x3):\n",
    "    return x1 and x2 and x3\n",
    "\n",
    "def boolean_function_5(x1, x2, x3):\n",
    "    return not (x1 and x2 and x3)\n",
    "\n",
    "# Test for different Boolean functions\n",
    "boolean_functions = [boolean_function_1, boolean_function_2, boolean_function_3, boolean_function_4, boolean_function_5]\n",
